 Valid Host Password'=>'Por favor, introduce una contraseña de servidor válida','Please Enter Valid Host Username'=>'Por favor, introduce un nombre de usuario de servidor válido','Get Preview Recods'=>'Obtener registros preliminares','If your <b>.htaccess</b> file were writable, we could do this automatically, but it isn’t. So you must either make it writable or manually update your .htaccess with the mod_rewrite rules found under <b>WP Settings >> Permalinks</b>. Until then, the exported and imported files are not protected from direct access.'=>'Si tu archivo <b>.htaccess</b> tuviera permisos de escritura, podríamos hacer esto automáticamente, pero no los tiene. Así que tienes que darle permisos de escritura o actualizar tu .htaccess manualmente con las reglas de mod_rewrite que se encuentran en <b>Ajustes de WP >> Enlaces permanentes</b>. Hasta entonces, los archivos exportados e importados no están protegidos del acceso directo.']];